import './Tarjeta.css';

function Tarjeta() {
  return (
    <div class="Tarjeta">
        <div className="icon">
            <img src="./sources/profile-user.png" alt="Icono de usuario"></img>
        </div>  
        <h1 class="tittle">Presentacion</h1>
    </div>
  );
}

export default Tarjeta;
